    </div>
  );
}

function Cards (){
  return <>
    <div className="cards">
      <Card/>
    </div>
  </>
}

function InnerCard(title){
  return <>
    <div className="card"><p>{title}</p></div>
  </>
}

function Card (){
  let cards = [];
  for (let i = 0; i < 20; i++) {
    cards.push(InnerCard(annonces[i].title));
  }
  return <>{cards}</>
}

